class DemoModel {
  DemoModel({
      List<UpcomingGames>? upcomingGames,
      List<PastGames>? pastGames,
      bool? error,
      dynamic message,}){
    _upcomingGames = upcomingGames;
    _pastGames = pastGames;
    _error = error;
    _message = message;
}

  DemoModel.fromJson(dynamic json) {
    if (json['upcoming_games'] != null) {
      _upcomingGames = [];
      json['upcoming_games'].forEach((v) {
        _upcomingGames!.add(UpcomingGames.fromJson(v));
      });
    }
    if (json['past_games'] != null) {
      _pastGames = [];
      json['past_games'].forEach((v) {
        _pastGames!.add(PastGames.fromJson(v));
      });
    }
    _error = json['error'];
    _message = json['message'];
  }
  List<UpcomingGames>? _upcomingGames;
  List<PastGames>? _pastGames;
  bool? _error;
  dynamic _message;
DemoModel copyWith({  List<UpcomingGames>? upcomingGames,
  List<PastGames>? pastGames,
  bool? error,
  dynamic message,
}) => DemoModel(  upcomingGames: upcomingGames ?? _upcomingGames,
  pastGames: pastGames ?? _pastGames,
  error: error ?? _error,
  message: message ?? _message,
);
  List<UpcomingGames>? get upcomingGames => _upcomingGames;
  List<PastGames>? get pastGames => _pastGames;
  bool? get error => _error;
  dynamic get message => _message;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    if (_upcomingGames != null) {
      map['upcoming_games'] = _upcomingGames!.map((v) => v.toJson()).toList();
    }
    if (_pastGames != null) {
      map['past_games'] = _pastGames!.map((v) => v.toJson()).toList();
    }
    map['error'] = _error;
    map['message'] = _message;
    return map;
  }

}

